(25, 'Cho thuê trọ công nhân vs người lao động', 'cho-thue-tro-cong-nhan-vs-nguoi-lao-dong', '2023-01-12__nhatro5.jpg', 'Thoáng mát mùa hè, ấm áp mùa đông. Hạ tầng nội thất khép kín, điện nước giá nhà nước, wifi dùng thì chia. Gần chợ, quán ăn , coffee, trường đhsp- đhbk, KDC sầm uất. Có sân phơi và để xe,(2 ng 1tr5, 3ng 1tr7). An ninh tuyệt đối. Giờ giấc tự do. Khuyến khích Ace lao động', 3, 8, 42, 1500000, 2, 2, 1, 25, '20 Phạm Như Xương', 'Phạm Như Xương, Phường Hòa Khánh Nam, Quận Liên Chiểu', NULL, 0, NULL, 1, '2023-01-12', '2023-01-17', 6, 0, NULL, 0, NULL, '2023-10-16 02:43:18', '2023-11-26 08:56:28'),
(26, 'Cho thuê phòng trọ full nội thất đẹp. Giá: từ 3,2Tr đến 3,3Tr tuỳ phòng', 'cho-thue-phong-tro-full-noi-that-dep-gia-tu-32tr-den-33tr-tuy-phong', '2023-01-12__nhatro7.jpg', 'Vị trí thuận tiện gần các trường đại học, chợ Hoà Khánh, trung tâm y tế quận Liên Chiểu. Mới xây toàn bộ, nội thất đẹp, thoáng mát. Tiện ích: giường tủ gỗ, kệ bếp, hút mùi, máy lạnh, máy nước nóng, sân phơi trong phòng. Thích hợp gia đình hoặc 2 bạn ở chung.', 3, 8, 42, 3200000, 4, 3, 3, 40, '493 Tôn Đức Thắng', 'Tôn Đức Thắng, Phường Hòa Khánh Nam, Quận Liên Chiểu', NULL, 0, NULL, 1, '2023-01-12', '2023-01-22', 6, 0, NULL, 0, NULL, '2023-10-16 02:43:18', '2023-11-26 08:56:28'),
