(28, 'Cho thuê mặt bằng kinh doanh hoặc văn phòng có 6 phòng mặt tiền Lê Văn Hiến', 'cho-thue-mat-bang-kinh-doanh-hoac-van-phong-co-6-phong-mat-tien-le-van-hien', '2023-01-12__matbang2.jpg', 'Diện tích 5/21 105m2 có 6 phòng ngủ. Có khu vực bếp riêng rộng rãi. Có chổ để xe máy oto. Có giường Nệm, Tủ, Bàn Ghế, Cửa sổ lớn thoáng mát. Có điều hoà, nóng lạnh, có máy giặt , Tủ lạnh .Điện 3K/1 số nước giá rẻ', 3, 7, 48, 12000000, 7, 8, -2, 105, '615 Lê Văn Hiến', 'Lê Văn Hiến, Phường Hòa Hải, Quận Ngũ Hành Sơn, Đà Nẵng', NULL, 0, NULL, 3, '2023-01-12', '2023-01-22', 6, 0, NULL, 0, NULL, '2023-10-16 02:43:18', '2023-11-26 08:56:28'),
