(31, 'Mặt bằng đẹp cho mở quán ăn, chuyển phát nhanh, văn phòng công ty.... đường vào sân bay', 'mat-bang-dep-cho-mo-quan-an-chuyen-phat-nhanh-van-phong-cong-ty-duong-vao-san-bay', '2023-01-21__matbang3.jpg', 'Mặt bằng đẹp cho bán hàng ăn sáng trưa, chiều, tối, khuya. Văn phòng hoặc chuyển phát nhanh.Trên đường vào và gần sân bay, nơi có hàng nghìn người có nhu cầu ăn(vì trong sân bay quá đắt). Mặt tiền có thể sử dụng 7,5m. Vỉa hè 6m. Hợp đồng 1 năm, cọc 1 tháng, trả tiền hàng tháng', 3, 11, 19, 8000000, 6, 5, -2, 60, '20 Duy Tân', '20 Duy Tân phường Hòa Thuận Tây', NULL, 0, NULL, 3, '2023-01-27', '2023-01-29', 1, 0, '<iframe src=\"https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3834.310912407628!2d108.2198753!3d16.0493479!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x314219c69d48a5f9%3A0xfbac44179a5101d!2zMjAgRHV5IFTDom4sIEjDsmEgVGh14bqtbiDEkMO0bmcsIEjhuqNpIENow6J1LCDEkMOgIE7hurVuZyA1NTAwMDA!5e0!3m2!1svi!2s!4v1674314530448!5m2!1svi!2s\" width=\"600\" height=\"450\" style=\"border:0;\" allowfullscreen=\"\" loading=\"lazy\" referrerpolicy=\"no-referrer-when-downgrade\"></iframe>', 0, NULL, '2023-10-16 02:43:18', '2023-10-16 16:44:58'),
