(33, 'CHO THUÊ PHÒNG TRỌ PHÒNG ĐẸP NHƯ KHÁCH SẠN FULL NỘI THẤT', 'cho-thue-phong-tro-phong-dep-nhu-khach-san-full-noi-that', '2023-01-27__nhatro11.jpg', 'Mình cho thuê phòng ngay Phạm Thiều - Hồ Nghinh - Sơn trà - TP Đà Nẵng Cách biển vài bước chân\r\n\r\n50 phạm Thiều - Sơn Trà- Tp Đà Nẵng\r\n\r\nPhòng đơn : 2tr8 - 3tr5/1 phòng\r\n\r\nTiện ích xung quanh :\r\n\r\nCách biển Biển vài bước chân .\r\n\r\nNgay chợ An hải đông . Chợ Phước Mỹ.\r\n\r\nSân phơi , bãi đậu thoải mái , số lượng người ở thoải mái , quản lý toà nhà 24/24 , không chung chủ , giờ giấc tự do .\r\nĐầy đủ tiện nghi gồm có :\r\n\r\n- Giường\r\n\r\n- Nệm\r\n\r\n- Điều hoà\r\n\r\n- Tủ quần áo\r\n\r\n-Nước nóng lạnh\r\n\r\n-Tủ lạnh\r\n\r\n- Wifi free\r\n\r\n- Máy giặt free\r\n\r\n-Bếp chung\r\n\r\n-Thang máy\r\n\r\nHình thức thanh toán linh hoạt\r\n\r\nCọc 1 thanh toán 1', 3, 4, 50, 2800000, 3, 2, 2, 25, '50 Phạm Thiều', '50 Phạm Thiều, Phường An Hải Bắc, Quận Sơn Trà, Đà Nẵng', NULL, 0, NULL, 1, '2024-04-10', '2024-04-20', 1, 5, '<iframe src=\"https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3833.872404657072!2d108.24232570000001!3d16.0721097!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x3142178614d058dd%3A0x7b7df413712153b5!2zNTAgUGhhzKNtIFRoacOqzIB1LCBQaMaw4bubYyBN4bu5LCBTxqFuIFRyw6AsIMSQw6AgTuG6tW5nIDU1MDAwMA!5e0!3m2!1svi!2s!4v1674784808887!5m2!1svi!2s\" width=\"600\" height=\"450\" style=\"border:0;\" allowfullscreen=\"\" loading=\"lazy\" referrerpolicy=\"no-referrer-when-downgrade\"></iframe>', 0, NULL, '2023-10-16 02:43:18', '2024-04-03 16:32:43'),
